// Importing Modules :
import React from 'react';

import {Name} from "./App"

const Contact = (props)=>{
    return(
        <>
            
        

        <Name.Consumer>
                {
                    (data)=>{
                        console.log("This is Provide" ,data)
                        return(
                        <>
                        This is CONTACT-US Page {props.name}.
                        My name is {data}
                        </>
                    )}
                }
        </Name.Consumer>
        
        
        </>
    )
}

// Exporting Contact COmponent :
export default Contact;
